import "./about.css"

export const About = () => {
    return (
        <div className="about">
            Hi, i am Sagar. I am a recent Information System graduate with minor in software engineering. I started my professional journey from Nepal in a Commercial Bank of Nepal. I started as a trainee working on various projects as business analyst and associate project manager. I am thankful to this role as it brought out the extovert in me. Through this role,i became more confident in communication and persuasion ability. Juggling multiple projects and managing stakeholders gave me strenght to work under pressure. All in all, i grew a lot. Just like people level up in games, i also leveled up through this role during my three year career. I also realised the role of tech in banking as well as any industry as the company i was working for started to lunch technology transformation projects. I also realised other competitors were strongly adopting new technology to gain competitive advantage. This made me ralise that i had to upskill myself.
            This was the main reason for my journey to Asutralia. 

        </div>
    )
}
